import { Container, List, ListItemButton, ListItemIcon, ListItemText, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from "@mui/material";

import { Colors } from '../../styles/theme';
import RemoveIcon from '@mui/icons-material/Remove';
import AddIcon from '@mui/icons-material/Add';

export default function CartTable (){
    return(
        <Container>
        <TableContainer sx={{padding:'20px 0'}}>
            <Table>
            <TableHead>
                <TableRow>
                    <TableCell sx={{textAlign:"center"}}>Item</TableCell>
                    <TableCell sx={{textAlign:"center"}}>Price</TableCell>
                    <TableCell sx={{textAlign:"center"}}>Count</TableCell>
                    <TableCell sx={{textAlign:"center"}}>Total</TableCell>
                </TableRow>
            </TableHead>
            <TableBody>
                <TableRow>
                    <TableCell sx={{textAlign:"center"}}>Item 1</TableCell>
                    <TableCell sx={{textAlign:"center"}}>2.90</TableCell>
                    <TableCell sx={{textAlign:"center"}}>
            <List sx={{
                display:"flex",
                alignItems:"center",
                width:"50%",
                background:Colors.light_gray,
                padding:"0",
                margin:'auto'

            }}>
                <ListItemButton   sx={{
                    background:Colors.white,
                    justifyContent:"center",
                    width:"40px",
                    marginLeft:"4px",
                }}>
                    <ListItemIcon  sx={{
                    background:Colors.white,
                    justifyContent:"center"
                }}><RemoveIcon/></ListItemIcon>
                </ListItemButton>
                <ListItemButton >
                    <ListItemText sx={{
                        textAlign:"center"
                    }}>Count</ListItemText>
                    </ListItemButton>
                <ListItemButton  sx={{
                    background:Colors.white,
                    justifyContent:"center",
                    width:"40px",
                    marginRight:"4px",
                }} > <ListItemIcon  sx={{
                    background:Colors.white,
                    justifyContent:"center"
                }}><AddIcon/></ListItemIcon></ListItemButton>

            </List>
            </TableCell>
                    <TableCell sx={{textAlign:"center"}}>49.0</TableCell></TableRow>
            </TableBody>
            </Table>
        </TableContainer>
        </Container>
    )
}
